"use strict";

function f_gold(c) {
    const sqrt = Math.sqrt;
    let a = 0, b = parseInt(sqrt(c));
    while (a <= b) {
        let s = a ** 2 + b ** 2;
        if (s === c) {
            return true;
        }
        if (s < c) {
            a += 1;
        } else {
            b -= 1;
        }
    }
    return false;
}
